/** Sorts via stable in-place InsertionSort algorithm (O(n<sup>2</sup>))
 *(ideal for small collections which are mostly presorted). */
public final void insertionSort(int lo, int hi) {
  for (int i = lo + 1 ; i <= hi; i++) {
    for (int j = i; j > lo; j--) {
      if (compare(j - 1, j) > 0) {
        swap(j - 1, j);
      } else {
        break;
      }
    }
  }
}

